import React from 'react';

function Popup(props) {
    const style = {
        display:'flex',
        justifyContent:'center',
        alignItems: 'center',
        height: '100px',
        width: '100px',
        border: 'solid #000',
        borderWidth:' 3px 3px 3px 1px'
    }
  return (
      <div class='popup' style={style}>
          <p>{props.text}</p>
      </div>
  );
}

export default Popup;
